CREATE TABLE `Stops` (
  `idstop` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `latitude` double DEFAULT NULL,
  `longitude` double DEFAULT NULL,
  `webId` int(10) unsigned DEFAULT NULL,
  `provider` int(10) unsigned NOT NULL,
  PRIMARY KEY (`idstop`),
  KEY `fk_Stops_Provider` (`provider`),
  CONSTRAINT `fk_Stops_Provider` FOREIGN KEY (`provider`) REFERENCES `Providers` (`idProvider`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=4837 DEFAULT CHARSET=utf8;




